import React from 'react'

function AnhSp(props) {
    let { sachMoi } = props;
    console.log(sachMoi);
    return (

        <div className="col-md-4 khoianh">
            {sachMoi.map((item) => {
                <div className="anhto mb-4">
                    <a
                        className="active"
                        href="images/lap-ke-hoach-kinh-doanh-hieu-qua-mt.jpg"
                        data-fancybox="thumb-img"
                    >
                        <img
                            className="product-image"
                            src={item.image}
                            alt="lap-ke-hoach-kinh-doanh-hieu-qua-mt"
                            style={{ width: "100%" }}
                        />
                    </a>

                </div>

            })}


        </div>
    )
}

export default AnhSp
